def main():
    import sys
    data = sys.stdin.read().split()

    n = int(data[0])
    persons = list(map(int, data[1:1+n]))
    q = int(data[1+n])

    # Initialize positions - initially all people are at position 1
    positions = [1] * n

    results = []
    index = 1 + n + 1
    for _ in range(q):
        a = int(data[index]); b = int(data[index+1]); index += 2
        if a == b:
            results.append(str(persons[a-1]))
        else:
            # Find the minimum position between a and b
            min_pos = float('inf')
            for i in range(n):
                if a <= persons[i] <= b:
                    pos = positions[i]
                    if pos < min_pos:
                        min_pos = pos

            results.append(str(min_pos))

        # Update positions
        for i in range(n):
            if persons[i] >= a and persons[i] <= b:
                positions[i] = min(positions[i], min_pos)

    print("\n".join(results))

